Az eltelt évek alatt számos formációban adta tanúbizonyságát tehetségének, színpadra termettségének. A 2009-ben megjelent Ha egy nő szeret... című második szólóalbuma már az érett dalszerző alkotásait vonultatja fel. Népszerűségét mi sem mutatja jobban, mint hogy Európa számos országából érkeznek felkérések, dalai koreográfusokat, festőket, szobrászokat ihletnek meg. Pályafutása során számos eredményt ért el, melyek közül kiemelkedik a Veszprémi Utcazene Fesztivál, melyet 2008-ban megnyert. Fell
